import bannerImage from '../../assets/banner.jpg'

const Header = (props) => {
  return (
    <Fragment>
      <header className={classes.header}>
        <h1>Store_name</h1>
        <button>Cart</button>
      </header>
      <div className={classes['main-image']}>
        <img src={bannerImage} alt='Description of the banner image'/>
      </div>
    </Fragment>
  );
};
